import axios from 'axios';

create({
    baseURL: "http://127.0.0.1:8000/api/Items/",
    headers: {
        'Accept':'application/json',
        'Content-Type':'application/json',
    }
})

// export default axios.update
update({
    baseURL: "http://127.0.0.1:8000/api/<int:pk>/",
    headers: {
        'Accept':'application/json',
        'Content-Type':'application/json',
    }
})

//export default axios.delete
Delete({
    baseURL: "http://127.0.0.1:8000/api/<int:pk>/Delete/",
    headers: {
        'Accept':'application/json',
        'Content-Type':'application/json',
    }
})

export default axios;
